description:
Dans le centre de Libramont, à deux pas des sites de formation de la Haute Ecole Robert Schuman et de la gare, venez visiter cette jolie maisonnette rénovée partiellement et réaffectée en immeuble à kots. L'immeuble se compose au RDC : hall d'entrée, kot 1 (11m²), living-salon (12m²), cuisine équipée avec salle à manger (17m²), annexe buanderie ; 1er étage : hall de nuit, kots 2 et 3 (13,5 - 15m²), salle de bain avec paroi douche, double évier et wc ; 2ème et 3ème étage : kot 4 (15m²) et studio-duplex de 21m² avec chambre, bureau-dressing et salle de douche privative avec wc. Caves, terrasse et jardin.

La cuisine est entièrement équipée. De nombreux équipements restent, tels que la salle à manger, le fauteuil et la télévision du salon, le lave-linge, ... 

Les loyers sont de : 

Kot n°1 : 250€/mois ;
Kot n°2 : 290€/mois ;
Kot n°3 : 310€/mois Loué ; 
Kot n°4 : 230€/mois ;
Studio/Duplex : 350€/mois Loué.
A ces loyers, il faut ajouter une charge de 50€/mois pour l'électricité, l'eau et le chauffage mazout.

